//modulo donde exporto funciones javascript para hacer peticiones ajax al servicio RESTFULL montado sobre NODEJS
export async function registrarCliente({ nombre, apellidos, email, login, password, telefono }) {
    try {
      if (login === '') {
        login = email;
      }
  
      const response = await fetch('http://localhost:5000/api/Cliente/Registro', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ nombre, apellidos, email, login, password, telefono }),
      });
  
      if (response.status === 200) {
        const data = await response.json();
        return data;
      } else {
        return {
          codigo: response.status,
          mensaje: 'Error in the request to register the client.',
        };
      }
    } catch (error) {
      console.error('An error occurred:', error);
      return {
        codigo: -1,
        mensaje: 'An error occurred while processing the request.',
      };
    }
  }
